import {path, base64Encode, base64Decode, assertStrictEquals} from "std";
import * as encodeUtil from "../encodeUtil.js";

const FILES_DIR = path.join(path.dirname(path.fromFileUrl(import.meta.url)), "files");

Deno.test("petcat", async () =>
{
	const decodedData = await encodeUtil.decode(await Deno.readFile(path.join(FILES_DIR, "g>wellen")), "PETSCII");
	assertStrictEquals(base64Encode(decodedData), "");
});

