Deno.test("decodeMacintosh-romanUTF8", async () =>
{
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "01-1-tiff-éËíÀ‰ªäG", processors : encodeUtil.macintoshProcessors.romanUTF8, region : "japan"}), "01-1-tiff-手塚莉絵");
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "ÉAÉbÉvÉãä÷òAÉ\\ÉtÉg", processors : encodeUtil.macintoshProcessors.romanUTF8, region : "japan"}), "アップル関連ソフト");
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : new TextDecoder("iso-8859-1").decode(await Deno.readFile(path.join(FILES_DIR, "apple.html"))), processors : encodeUtil.macintoshProcessors.romanUTF8, region : "japan"}), "アップル関連ソフト");

	const inputData = new TextDecoder("iso-8859-1").decode(await Deno.readFile(path.join(FILES_DIR, "apple_full.html")));
	const decodeOpts = {data : inputData, processors : encodeUtil.macintoshProcessors.romanUTF8, region : "japan", preserveWhitespace : true};
	assertStrictEquals(base64Encode(await encodeUtil.decodeMacintosh(decodeOpts)), "");

	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "BACKGROUND IMAGE", processors : encodeUtil.macintoshProcessors.romanUTF8, region : "japan", preserveWhitespace : true}), "BACKGROUND IMAGE");
});

Deno.test("decodeMacintosh-percentHex", async () =>
{
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "Test%%aabbcc", processors : encodeUtil.macintoshProcessors.percentHex, region : "roman"}), "Test%aabbcc");
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "01-1-tiff-%8e%e8%92%cb%e4%bb%8aG", processors : encodeUtil.macintoshProcessors.percentHex, region : "japan"}), "01-1-tiff-手塚莉絵");
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "LoopDeLoop%c4", processors : encodeUtil.macintoshProcessors.percentHex, region : "roman"}), "LoopDeLoopƒ");
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "Icon\r.rsrc hello\tworld  good\nbye", processors : encodeUtil.macintoshProcessors.percentHex, region : "roman"}), "Icon↵.rsrc hello⇥world  good␤bye");
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "JoliPhone Pro 3.5 d%8emo", processors : encodeUtil.macintoshProcessors.percentHex, region : "roman"}), "JoliPhone Pro 3.5 démo");
	
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "Aladdin %83I%81[%83_%81[%83t%83H%81[%83%80", processors : encodeUtil.macintoshProcessors.percentHex, region : "japan"}), "Aladdin オーダーフォーム");
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "%82%b1%82%cc%83p%83b%83`%82%c9%82%c2%82%a2%82%c4", processors : encodeUtil.macintoshProcessors.percentHex, region : "japan"}), "このパッチについて");
});

Deno.test("decodeMacintosh-octal", async () =>
{
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "Demo\\ Vault\\ \\304", processors : encodeUtil.macintoshProcessors.octal, region : "roman"}), "Demo Vault ƒ");
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "test\\ of\\tthe\\rsystem\\nohyah", processors : encodeUtil.macintoshProcessors.octal, region : "roman"}), "test of⇥the↵system␤ohyah");
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "hrm\\bbell\\fform feed\\\\backslash\\\"quoted\\\"not", processors : encodeUtil.macintoshProcessors.octal, region : "roman"}), "hrm⍾bell␌form feed\\backslash\"quoted\"not");
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "Un/Comment", processors : encodeUtil.macintoshProcessors.octal, region : "roman"}), "Un⁄Comment");
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "\\001\\001TattleINIT", processors : encodeUtil.macintoshProcessors.octal, region : "roman"}), "□□TattleINIT");
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : "QD\\1773D", processors : encodeUtil.macintoshProcessors.octal, region : "roman"}), "QD□3D");
	assertStrictEquals(await encodeUtil.decodeMacintosh({data : `\\"Collapse\\"\\ plug-ins\\ coming`, processors : encodeUtil.macintoshProcessors.octal, region : "roman"}), `"Collapse" plug-ins coming`);
});

